import React from 'react';
import './App.scss';
import Container from '@material-ui/core/Container';

class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
    };
  }
  componentDidMount() {
  }
  render(){
    return ( 
      <div className = "App" >
      <div className="navbar">
        <Container fixed >
        < img class = "img-fluid"
        alt = "logo brand nobo noir"
        src = {require('./images/nobo-logo.png')} /> 
        </Container> 
      </div>

      <Container fixed className="content">
        <div className="content-search">
        <InputBase
        className={classes.input}
        placeholder="Search Google Maps"
        inputProps={{ 'aria-label': 'search google maps' }}
      />
      <IconButton className={classes.iconButton} aria-label="search">
        <SearchIcon />
      </IconButton>
      <Divider className={classes.divider} orientation="vertical" />
      <IconButton color="primary" className={classes.iconButton} aria-label="directions">
        <DirectionsIcon />
      </IconButton>
        </div>
      </Container>
      <div className="footer">
        <Container fixed className="footer-content" >
        < img class = "logo-footer"
        alt = "logo brand nobo blanc"
        src = {require('./images/nobo-logo-white.svg')} /> 
        <p>Test Technique Nobo</p>
        </Container> 
      </div>
      </div>
    );
  }

}

export default App;
